import React, { Component } from 'react'

const listData = ['김유신','강감찬','유관순']

class Hello extends Component{
    constructor(props){
        super(props);
        this.state={
            name: '채형국'
        }
    }
    render(){
        return(
            <div>
                <h1>{this.state.name}</h1>
            </div>
        );
    }
}
export default Hello;
